import { ButtonGroup, Button } from "react-bootstrap";

function PreflopCharts(){

    const games = ["Online Cash", "MTT"];

    const onlineCashOptions = [
      ["RFI", "VS RFI", "RFI VS 3-Bet", " VS 4-Bet"],
      ["UTG", "HJ", "CO", "BTN", "SB", "BB"],
      ["UTG", "HJ", "CO", "BTN", "SB", "BB"]
    ];

    let randomizer = "--";

    return(
        <div>
            <ButtonGroup aria-label="Basic example">
                {games.map((item) => { return <Button variant="secondary">{item}</Button>})}
            </ButtonGroup>
            {onlineCashOptions.map((item) => { return (
                <ButtonGroup aria-label="Basic example">
                    {item.map((subitem) => { return <Button variant="secondary">{subitem}</Button>})}
                </ButtonGroup>
            )})}
        </div>
    )
}

export default PreflopCharts;
